const Movies = () =>{
    const [movies, setMovies] = useState([])
    useEffect( () =>{
        let moviesList = [
            {
                id:1,
                title : "Highlender",
                release_date: "1986-03-06",
                runtime: 166,
                mpaa_rating: "R",
                description: "SOmething here",
            },
            {
                id:1,
                title : "the boys",
                release_date: "2022-04-05",
                runtime: 90,
                mpaa_rating: "PG-13",
                description: "SOmething longfdasfadsf",
            },
        ]
        setMovies(moviesList)
    }, []);

    return (
            <div>
                <h2>Movies</h2>
                <hr />
                <table className="table table-stripped table-hove">
                    <thead>
                        <tr>
                            <th>Movie</th>
                            <th>Release Date</th>
                            <th>Rating</th>

                        </tr>
                    </thead>
                    <tbody>
                        {movies.map((m) => {
                            <tr key={m.id}>
                                <td></td>
                            </tr>
                        })}
                    </tbody>
                </table>
            </div>
    )
}

export default Movies;
